import React from 'react';
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import { NavLink } from 'react-router-dom';
// Material Components
import Divider from '@material-ui/core/Divider';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemIcon from '@material-ui/core/ListItemIcon';
import ListItemText from '@material-ui/core/ListItemText';

const styles = {
  root: {
    position: 'fixed',
    left: 0,
    right: 0,
    bottom: 0,
    borderTop: '1px solid #303030',
    height: 'auto',
    '& a': {
      textDecoration: 'none',
    },
    '& .MuiBottomNavigationAction-label': {
      background: 'transparent',
      padding: '0 10px',
      transition: '.3s',
    },
    '& .MuiButtonBase-root': {
      width: '100px',
      padding: '8px 0',
    }
  },
  activeNavlink: {
    '& .MuiBottomNavigationAction-label': {
      background: '#905a08',
    }
  },
  active: {}
};

class HeaderNav extends React.Component {
  state = {
    route: '/',
  };

  updateRoute = (event, route) => {
    let newRoute = event.currentTarget.attributes.route.nodeValue;
    this.setState({ route: newRoute });
  };

  render() {
    const { classes } = this.props;
    const { route } = this.state;
    const prayerBeadsIcon = <img src='/assets/images/prayer-bead.png' alt="logo" width="50" />,
          gourdSeedsIcon = <img src='/assets/images/gourd-seed.png' alt="logo" width="50" />,
          memoriesIcon = <img src='/assets/images/memories.png' alt="logo" width="50" />,
          prostheticsIcon = <img src='/assets/images/prosthetic.png' alt="logo" width="50" />,
          scaleIcon = <img src='/assets/images/treasure-carp-scale.png' alt="logo" width="50" />;

    return (
      <div>
        <Divider />
        <List>
          {['Inbox', 'Starred', 'Send email', 'Drafts'].map((text, index) => (
            <ListItem button key={text}>
              <ListItemIcon>{prayerBeadsIcon}</ListItemIcon>
              <ListItemText primary={text} />
            </ListItem>
          ))}
        </List>
        <Divider />
      </div>
    );
  }
}

HeaderNav.propTypes = {
  classes: PropTypes.object.isRequired,
};

export default withStyles(styles)(HeaderNav);
